import React from "react";
import "../home/project.css";
import logo from "../../assets/img/logo-choira.svg";
import o4 from "../../assets/img/o4.png";

import img1 from "../../assets/img/sliderImg/img1.png";
import img2 from "../../assets/img/sliderImg/img2.png";
import img3 from "../../assets/img/sliderImg/img3.png";
import img4 from "../../assets/img/sliderImg/img4.png";
import img5 from "../../assets/img/sliderImg/img5.png";
import { useEffect } from "react";

function Project() {
  useEffect(() => {
    var swiper = new window.Swiper(".mySwiper", {
      effect: "coverflow",
      grabCursor: true,
      centeredSlides: true,
      slidesPerView: 3,
      coverflowEffect: {
        rotate: 15,
        stretch: 70,
        depth: 300,
        modifier: 1,
        slideShadows: true,
      },
      loop: true,
      navigation: {
        nextEl: ".swiper-button-next",
        prevEl: ".swiper-button-prev",
      },
    });

    // Cleanup Swiper instance on component unmount
    return () => {
      swiper.destroy();
    };
  }, []);

  return (
    <>
      <div
        className="wrapper"
        // style={{ backgroundImage: "url(images/image-17.png)" }}
      >
        <div className="overlay"></div>
        <div className="navbar">
          <div>
            <img src={logo} alt="Choira Logo" style={{ cursor: "pointer" }} />
          </div>
          <div className="list">
            <h3>Home</h3>
            <h3>Soundtracks</h3>
            <h3>Jam</h3>
            <h3>Projects</h3>
            <h3>Signin</h3>

            <img className="o4" src={o4} alt="" />
          </div>
        </div>
        <div className="main-div">
          <div className="main">
            <div class="swiper mySwiper">
              <div class="swiper-wrapper">
                <div class="swiper-slide">
                  <h3>Tv Serial</h3>
                  <img src={img1} alt="" />
                </div>
                <div class="swiper-slide">
                  <img src={img2} alt="" />
                  <h3>Bollywood</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img3} alt="" />
                  <h3>Music Company</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img4} alt="" />
                  <h3>Soloist</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img5} alt="" />
                  <h3>Short Flim</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img2} alt="" />
                  <h3>Bollywood</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img3} alt="" />
                  <h3>Music Company</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img4} alt="" />
                  <h3>Soloist</h3>
                </div>
                <div class="swiper-slide">
                  <img src={img5} alt="" />
                  <h3>Short Flim</h3>
                </div>
              </div>
            </div>
            <div class="swiper-button-next"></div>
            <div class="swiper-button-prev"></div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Project;
